/* exported NotificationSound */
class NotificationSound {
    constructor() {
        this.sound = document.createElement('audio');

        if (this.sound.canPlayType('audio/wav') === '') {
            throw 'Unable to produce notification sounds.  Browser doesn\'t support wav audio files.';
        }

        this.sound.src = 'data:audio/wav;base64,';
    }

    play() {
        this.sound.play();
    }
}
